        fetch(API)
        .then(respone => respone.json())
        .then(transactions => console.log(transactions))
    })
    return (
        <div className="rootDiv">
            <Navbar />
            <h1 id="navHeader">BANK OF FLATIRON</h1>
        </div>
    )

}

export default App
